import "../styles/main.css";

const Coverr = () => {
  return (
    <div>
      <div className="container">
          <div className="layer1">
            <div className="cover">
              <div className="judul1">The wedding of</div>
              <div className="judul2 nama-pasangan">Nailal & Via</div>
              <div className="quotes">
                “And I knew exactly how old Walt Disney's Cinderella felt when
                she found her prince.”   — Elizabeth Young
              </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Coverr;
